import React from "react";
import "../Styles/Table.css";

export const Table = () => {
  return (
    <div className="main">
      <div className="above-table">
        <h4 className="paragraph-header">Anchor Charts</h4>
        <p className="intro">
          Use these visual skills summary charts in printable or slide format to
          bridge multilingual learners toward English proficiency, or use
          <b> Anchor Charts in Spanish</b> to provide more support as needed.
        </p>
      </div>
    </div>
  );
};

export default Table;
